import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


import Grid from "@material-ui/core/Grid"
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";

function App() {
  return (
    <div className="app">
      <SearchBar />
      <MovieList />
    </div>
  );
}

function SearchBar() {
  return (
    <div id="search">
      <h1>Movies</h1>
      <input
        id="searchBar"
        type="text"
        placeholder="Search Movies"
      />
      <button className="searchBtn">Find Movies</button>
    </div>
    );
}

function MovieList() {
  return (
    <div className="movieList">
      <MovieCard/>
      <MovieCard/>

    </div>
  );
}

function MovieCard() {
  return (
    <div >
      <Card  style={{backgroundColor: 'transparent', margin: "25px", borderRadius: "20px"}}>
        <CardActionArea >
          <Grid container
            className="cardGridContainer"
            direction = "column"
            justify = "center"
            spacing = {2} >
            <Grid item>Movie Name</Grid>
            <Grid item>release data</Grid>
            <Grid item>runtime</Grid>
            <Grid item>genre</Grid>
            <Grid item>genre</Grid>
          </Grid>
        </CardActionArea>
      </Card>
    </div>
  );
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
